    public static int check(int x, int[] A, int[] B) {
        int a = 0;
        int b = 0;
        for(int i = 0; i< A.length; i++) {
            // The idea is check if both array elements are not same with first entry then return -1. For example value to check is 1 and A[i] = 2 and B[i] = 3
            // it means neither A[] or B[] can be arranged with all same values by swapping.
            if (A[i] != x && B[i] != x){
                return -1;
            }else if (A[i] != x) {
                a++;
            } else if (B[i] != x) {
                b++;
            }
        }
        return Math.min(a, b);
    }

    public static int count(int[] A, int[] B) {

        int x = check(A[0], A, B);
        int y = check(B[0], A, B);

        return (x >-1 && y>-1 )? Math.min(x,y): Math.max(x,y);
    }
